@AndrewEwing11 @amymitchellart Scale comparison: 34,800 HIV infections in the U.S. in 2019, of which 6,400 in women.

SARS-CoV-2 is worse as long as reinfections continue, yet no one worldwide - outside China - seems to have a plan?

This is such stunning dysfunction, as a scholar of governance I'm speechless. https://t.co/x6ohgvKCPw
